CREATE TABLE oq_sample.nodes
(
    id bigint NOT NULL,
    version integer NOT NULL,
    user_id integer NOT NULL,
    tstamp timestamp without time zone NOT NULL,
    changeset_id bigint NOT NULL,
    tags hstore,
    geom geometry(Point,4326),
    CONSTRAINT pk_nodes PRIMARY KEY (id)
);


INSERT INTO oq_sample.nodes
SELECT distinct (public.OQ_NodesTableFromWays(nodes, linestring)).*
FROM oq_sample.oq_s1a_building;

SELECT * FROM oq_sample.nodes;

DROP TABLE IF EXISTS oq_sample.way_nodes;
CREATE TABLE oq_sample.way_nodes
(
    way_id bigint NOT NULL,
    node_id bigint NOT NULL,
    sequence_id integer NOT NULL,
    CONSTRAINT pk_way_nodes PRIMARY KEY (way_id, sequence_id)
);

INSERT INTO oq_sample.way_nodes
